    def filterPipe(self):
        if self.linePipeFile.text() != '':
            f = open(self.linePipeFile.text(), "r")
            dodaifile = len(f.read().splitlines())
            self.progressBar.setMinimum(0)
            self.progressBar.setMaximum(dodaifile - 1)
            self.label_progress.setText("Please wait. Getting Attributes from file: " + os.path.basename(self.linePipeFile.text()))
            fileopen = open(self.linePipeFile.text(), "r")
            dong = fileopen.readline()
            cot = self.comboKeepType.currentIndex()
            matrix_conduit = []
            for i in range(0, dodaifile - 1):
                dong = fileopen.readline().strip()
                for j in range(0, len(dong.split(','))):
                    matrix_conduit.append(dong.split(',')[cot-1])
                # Cap nhat thanh Progress
                self.progressBar.setValue(i)
                self.progressBar.update()
            fileopen.close()
            matrix_conduit = list(dict.fromkeys(matrix_conduit))
            for i in range(0, len(matrix_conduit)):
                self.plainConduitType.insertPlainText(matrix_conduit[i] + "\n")
            self.progressBar.setValue(0)
            self.progressBar.update()
            self.label_progress.setText("Complete Filtering Types of Pipes.")
        else:
            messagebox.showerror('Data Error', "Import Pipe File first.")
