    def openOrifice(self):
        if self.lineHeader.text() != '':
            file1 = filedialog.askopenfilename(title="Open Pump File", filetype=(("csv files", "*.csv"),))
            if file1 != '':
                # Clear Item(s) in ComboBoxes
                self.comboOrificeName.clear()
                self.comboOrificeDiameter.clear()
                self.comboOrificeFromNode.clear()
                self.comboOrificeToNode.clear()
