    def calculate(self):
        # Kiem tra su ton tai cua file bao loi
        if os.path.exists(os.path.dirname(self.lineOutputFile.text()) + '/warnings.log'):
            os.remove(os.path.dirname(self.lineOutputFile.text()) + '/warnings.log')
        if self.lineOutputFile.text() != '':
            kqfile = open(self.lineOutputFile.text(), "w")
            if self.lineHeader.text() != '':
                header_file = open(self.lineHeader.text(), "r")
                nd = header_file.read()
                header_file.close()
            else:
                messagebox.showerror('Data Error', "Import Header File.")
            kqfile.write('[TITLE]' + "\n" + ';;Project Title/Notes' + "\n" + self.lineProjectName.text() + "\n\n"
                         + '[OPTIONS]' + "\n" + ';;' + nd.replace(',', '  ') + "\n")
        # Lam viec voi Rain Gage
        if self.lineRaingageFile.text() != '':
            self.label_progress.setText("Reading Rain Gages. Please wait.")
            # Doc Raingage va luu vao DataFrame
            cot_raingage = [self.comboRaingageName.currentText(), self.comboRaingageX.currentText(), self.comboRaingageY.currentText(),
                            self.comboRainageDescription.currentText(), self.comboRaingageTag.currentText()]
            data_raingage = pd.read_csv(self.lineRaingageFile.text())
            df_raingage = pd.DataFrame(data_raingage, columns=cot_raingage, dtype=str)
            # In Rain Gages
            self.label_progress.setText("Writing Rain Gages. Please wait.")
            self.progressBar.setMaximum(len(df_raingage.index))
            nd = '[RAINGAGES]' + "\n"
            nd += ';;Name           Format    Interval SCF      Source' + "\n"
            nd += ';;-------------- --------- ------   ------   ----------' + "\n"
            kqfile.write("\n" + nd)
            for i in range(0, len(df_raingage.index)):
                bien1 = str(df_raingage[self.comboRaingageName.currentText()][i])
                bien2, bien3, bien4 = 'INTENSITY', '0:05', '0'
                if bien1 != 'nan':
                    bien1 = bien1.replace('.0', '')
                    bien1 = bien1.replace(' ', '_')
                    if self.comboRainageDescription.currentText() != '':
                        luu = str(df_raingage[self.comboRainageDescription.currentText()][i])
                        if luu != 'nan':
                            kqfile.write(';' + luu + "\n")
                    if self.checkBoxRainfall.isChecked():
                        bien5 = 'FILE'
                        bien7 = self.comboRainfallUnit.currentText()
                        bien6 = '"' + self.lineRaingageFile.text() + '" ' + str(bien1)
                    else:
                        bien5, bien6, bien7 = 'TIMESERIES', str(bien1), ''
                    kqfile.write(
                        bien1+'  '+bien2 +'  '+ bien3 + '  '+bien4+'  '+bien5+'  '+bien6+'  '+bien7+"\n")
                else:
                    messagebox.showerror('Data Error', "Name of Rain Gage is NULL.")
                self.progressBar.setValue(i)
                self.progressBar.update()
            self.progressBar.setValue(0)
        # Tao bien luu tru cac manhole duoc dung
